import React from 'react';
import './nav.css';
import { AiOutlineHome, AiOutlineUser } from 'react-icons/ai'; 
import { BiBook, BiMessageSquareDetail } from 'react-icons/Bi';
import { RiServiceLine } from 'react-icons/Ri'; 

const Nav = () => {
  return (
    <nav>
      <a ref='#'><AiOutlineHome/></a>
      <a ref='#about'><AiOutlineUser/></a>
      <a ref='#experience'><BiBook/></a>
      <a ref='#services'><RiServiceLine/></a>
      <a ref='#contact'><BiMessageSquareDetail/></a>

    </nav>
  )
}

export default Nav
